import React from 'react';
import PropTypes from 'prop-types';
import './ToolTips.css';

const ToolTip = ({ text }) => {
  return (
    <div className="tooltip">
      {text}
      <span className="tooltiptext">{text}</span>
      <p>{text}</p>
    </div>
  );
};

ToolTip.propTypes = {
  text: PropTypes.string.isRequired,
};

export default ToolTip;
